(window.webpackJsonp=window.webpackJsonp||[]).push([[108],{460:function(n,h,i){"use strict";i.r(h);var g=i(44),t=Object(g.a)({},(function(){var n=this,h=n.$createElement,i=n._self._c||h;return i("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[i("h1",{attrs:{id:"chuong-1074-khong-ra-đuoc"}},[i("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1074-khong-ra-đuoc"}},[n._v("#")]),n._v(" Chương 1074: Không ra được")]),n._v(" "),i("hr"),n._v(" "),i("p",[n._v("Chương 1074: Không ra được"),i("br"),i("br"),n._v("“Các ngươi đi theo ta liền biết...” Nhìn ra mọi người nghi ngờ, Kê Nham cười khổ một tiếng."),i("br"),i("br"),n._v("Theo sau lưng, trong mê vụ đi một hồi, đi tới một cái phòng."),i("br"),i("br"),n._v("Chung quanh che kín phong ấn cùng bẫy rập, đều đạt đến cấp bảy đỉnh phong, dường như cho dù Thiên Diệp Vương dạng này cường giả, rơi vào trong đó, cũng sẽ bị cứ thế mà giảo sát."),i("br"),i("br"),n._v("Thấy cảnh này, Trương Huyền nhẹ gật đầu."),i("br"),i("br"),n._v("Nhìn tới mặc dù đồng dạng bị vây ở chỗ này, Thiên Diệp Vương rõ ràng chiếm ưu thế cực lớn, lão viện trưởng đám người không cách nào chống lại, chỉ có thể trốn ở chỗ này bảo vệ tính mạng, những trận pháp này cùng bẫy rập, cũng đều là vì phòng ngừa phòng đánh lén."),i("br"),i("br"),n._v("Đẩy cửa đi vào, gian phòng chỉ có mười mấy mét vuông lớn nhỏ, chật hẹp không nói, còn không có cửa sổ, chỉ có một viên Dạ Minh Châu, chiếu rọi bốn phía, có vẻ hơi u ám."),i("br"),i("br"),n._v("Một bên bên tường bên trên, dựa vào lấy một người, hai chân đã biến mất, trống trơn, cánh tay cũng chặt đứt một cái, có điều, nhìn thấy mọi người đi tới, lập tức bay lên, trong mắt tràn đầy khó tin."),i("br"),i("br"),n._v("“Kê viện trưởng, những này là...”"),i("br"),i("br"),n._v("Phong Thánh các bên trong tổng cộng liền mấy người bọn hắn, đột nhiên nhìn thấy tương đồng nhân loại, kích động trong lòng có thể tưởng tượng được."),i("br"),i("br"),n._v("“Đàm viện trưởng, là Thanh Nguyên đế quốc Ngô sư bọn họ, tìm được nơi này...” Kê Nham giải thích một câu."),i("br"),i("br"),n._v("“Đàm viện trưởng? Ngươi là phó viện trưởng Đàm Thanh?” Trương Huyền sửng sốt một chút, lập tức nhớ tới một người."),i("br"),i("br"),n._v("Hồng Viễn danh sư học viện, tổng cộng bốn vị phó viện trưởng, Mộ Nhân Hư, Kê Nham, Đàm Thanh, chính là trong đó ba cái."),i("br"),i("br"),n._v("“Là ta...” Đàm Thanh nhẹ gật đầu, nghi ngờ nhìn về phía cách đó không xa Kê Nham: “Mấy vị này danh sư, không biết xưng hô như thế nào?”"),i("br"),i("br"),n._v("“Cái này... Ta cũng là vừa mới gặp được bọn họ bị Thiên Diệp Vương đuổi giết, đem hắn cứu, còn họ tên, còn chưa kịp hỏi thăm...” Kê Nham nói."),i("br"),i("br"),n._v("Vừa rồi tình cảnh nguy cơ, không kịp nói tỉ mỉ, hắn chỉ nhận biết Ngô sư, cái khác ba vị, thật đúng là không quá quen thuộc."),i("br"),i("br"),n._v("“Vị này là Hồng Viễn học viện tân nhiệm viện trưởng Trương Huyền Trương sư, vị kia là Lạc Nhược Hi Lạc sư, vị kia là Thanh Nguyên đế quốc trận pháp sư công hội hội trưởng, Hàn Tự Hàn hội trưởng!” Ngô sư giới thiệu một chút."),i("br"),i("br"),n._v("“Tân nhiệm viện trưởng?”"),i("br"),i("br"),n._v("Nghe được giới thiệu, hai người đồng loạt nhìn qua, lông mày đồng thời nhăn lại."),i("br"),i("br"),n._v("Cho dù bọn họ bởi vì tình huống nguy cấp, không kịp hướng tổng bộ xin, đi thẳng tới nơi này, Hồng Viễn danh sư học viện, cũng là bốn đại học viện một trong... Làm sao sẽ để một cái chỉ có Tòng Thánh cấp bậc, hơn nữa trẻ tuổi như vậy tiểu gia hỏa trong sân dài?"),i("br"),i("br"),n._v("Đùa giỡn đi!"),i("br"),i("br"),n._v("“Trương viện trưởng mặc dù tuổi trẻ, thực lực nhưng không tầm thường, chúng ta sở dĩ có thể tìm tới nơi này, làm phiền hắn ra tay!” Thấy hai người biểu lộ, biết bọn họ nghĩ cái gì, mục sư vội vàng giải thích."),i("br"),i("br"),n._v("Nói thật, Trương Huyền tuổi tác thật sự là quá nhỏ, cho dù ban đầu là hắn, đột nhiên nhìn thấy đều sinh lòng hoài nghi, huống chi trước mắt hai vị."),i("br"),i("br"),n._v("“Cũng đúng, có thể đi tới nơi này, làm sao có thể đơn giản!”"),i("br"),i("br"),n._v("Nghe được Ngô sư lời nói, hai người sửng sốt một chút, lập tức giật mình."),i("br"),i("br"),n._v("Bọn họ tự mình trải qua cái này Khưu Ngô cung tàn khốc, biết nguy hiểm trong đó, có thể theo lối vào, cứ thế mà đi đến nơi này, tất nhiên có hơn người phong thái."),i("br"),i("br"),n._v("Huống chi Ngô sư đều tự mình mở miệng."),i("br"),i("br"),n._v("“Chương Dẫn Khâu viện trưởng đâu?”"),i("br"),i("br"),n._v("Trương Huyền cau mày, nhìn lại."),i("br"),i("br"),n._v("Không phải nói lão viện trưởng còn sống không? Không phải nói không đủ ba người ư? Làm sao không ở nơi này?"),i("br"),i("br"),n._v("“Chương viện trưởng...” Kê Nham cùng Đàm Thanh liếc mắt nhìn nhau, ánh mắt đồng thời ảm đạm xuống: “Hắn đã chết...”"),i("br"),i("br"),n._v("“Chết rồi? Kê viện trưởng, vừa rồi không còn nói các ngươi không đủ ba người sống ư? Hiện tại chỉ có hai cái...”"),i("br"),i("br"),n._v("Lần này nói chuyện chính là Hàn hội trưởng, rất hiển nhiên vừa rồi kê viện trưởng lời nói, hắn cũng nghe đi ra."),i("br"),i("br"),n._v("Trước mắt tổng cộng hai cái, nếu như chỉ có hai người bọn họ, nói thẳng hai cái liền xong việc, nhưng... Lại nói không được ba cái, đương nhiên có nguyên nhân."),i("br"),i("br"),n._v("Đường đường Thất Tinh danh sư, tuyệt không có khả năng loại sự tình này bên trên, đều xuất hiện nói sai."),i("br"),i("br"),n._v("“Còn có một cái, chính là Chương Dẫn Khâu, hắn cùng hắn nói là sống, nhưng cùng chết không có gì khác biệt... Bất quá, không ở nơi này, chỉ có thể chờ đợi đến đặc biệt thời gian, mang các ngươi đi gặp!”"),i("br"),i("br"),n._v("Kê Nham giải thích nói."),i("br"),i("br"),n._v("“Sống, chết rồi?” Mọi người nguyên một đám nhìn nhau, tất cả đều không rõ ràng cho lắm, chẳng qua nhìn đối phương bộ dạng, không có ý định nói tỉ mỉ, cũng liền lại không tiếp tục hỏi nữa."),i("br"),i("br"),n._v("Dừng lại một chút, Ngô sư nghi ngờ nhìn qua: “Hai năm trước đến cùng xảy ra chuyện gì? Vì cái gì biết rõ nơi này vô cùng nguy hiểm, không lên báo tổng bộ?”"),i("br"),i("br"),n._v("Thật ra thì không chỉ hắn không hiểu, ngay cả Trương Huyền cũng cảm thấy không thể tưởng tượng nổi."),i("br"),i("br"),n._v("Lão viện trưởng tại viện trưởng lăng lưu lại mộ chôn quần áo và di vật, khẳng định đã biết nơi này nguy hiểm, không phải thực lực của hắn có thể chống lại, đã như vậy, hẳn là báo lên cấp bậc cao hơn Danh Sư đường mới là, vì cái gì lựa chọn trầm mặc, mang theo học viện nhiều như vậy danh sư tới, cuối cùng... Tất cả đều đi một lần không về."),i("br"),i("br"),n._v("“Thật ra thì không phải là không muốn báo lên Danh Sư đường, mà là về thời gian không cho phép!”"),i("br"),i("br"),n._v("Kê Nham cười khổ lắc đầu: “Ngô sư cùng Chương viện trưởng quen thuộc, biết hắn sùng bái nhất chính là Ngô Dương Tử tiền bối, thích nhất sự tình chính là dò xét hắn cuộc đời cùng sự tích... Đi qua mọi cách dò xét, để hắn phát hiện liên quan tới chỗ này di tích một ít chuyện, hơn nữa cũng đã nhận được một chút tin tức hữu dụng. Ngay tại định báo lên Danh Sư đường thời điểm, không biết làm sao tin tức truyền đến Dị Linh tộc nhân trong tai, đồ vật bị lừa đi không nói, còn biết cấp độ càng sâu bí mật...”"),i("br"),i("br"),n._v("“Về sau, biết được di tích lập tức liền muốn mở ra, không thể bị dở dang, trong đêm liền đem chúng ta triệu tập lại, lúc này mới đuổi theo mà tới!”"),i("br"),i("br"),n._v("Nghe xong giải thích, Ngô sư nhíu mày: “Chương Dẫn Khâu có tổng bộ đưa tin ngọc bài, chỉ cần đưa tin, liền có thể báo cho tình huống, sẽ không chậm trễ quá nhiều thời gian... Vì cái gì không đi làm?”"),i("br"),i("br"),n._v("Đưa tin, cho dù đem cái này di tích chuyện nói rõ chi tiết một lần, cũng chỉ mười cái hô hấp công phu, có thể trong đêm có thể đem người triệu lên, nhanh chóng đuổi theo... Truyền cái tin tức, không khó lắm đi!"),i("br"),n._v(" Vì cái gì nói về thời gian không cho phép?"),i("br"),i("br"),n._v("“Nếu như đoán không sai, tin tức hẳn không phải là truyền đến Dị Linh tộc nhân trong tai, mà là... Bị lừa đi đi! Mà vị này lừa đảo, có phải hay không chính là tổng bộ tới? Để các ngươi đối tổng bộ, cũng không yên tâm?”"),i("br"),i("br"),n._v("Trương Huyền hơi chút suy tư, đã nghĩ thông suốt mấu chốt trong đó."),i("br"),i("br"),n._v("Nếu như không có kiêng kị, khẳng định đã sớm đưa tin."),i("br"),i("br"),n._v("“Cái này... Trương sư quả nhiên mắt sáng như đuốc, một cái nhìn ra vấn đề...”"),i("br"),i("br"),n._v("Nghe được hắn, Kê Nham, Đàm Thanh đồng thời miệng há mở, nhịn không được bái phục."),i("br"),i("br"),n._v("Theo vừa rồi đơn giản như vậy ngữ bên trong, liền đoán ra những này, trước mắt vị này Trương sư, quả nhiên phân biệt năng lực kinh người, khó trách có thể trở thành viện trưởng, quả thực không tầm thường."),i("br"),i("br"),n._v("“Lừa gạt đi? Tổng bộ tới?”"),i("br"),i("br"),n._v("Ngô sư sững sờ, lập tức nắm đấm xiết chặt."),i("br"),i("br"),n._v("Hắn cũng là người thông minh, lập tức nghĩ rõ ràng, đến cùng chuyện gì xảy ra."),i("br"),i("br"),n._v("Chương Dẫn Khâu bị tổng bộ tới một vị giả “Danh sư” lừa gạt, có phòng bị, Thanh Nguyên đế quốc Danh Sư đường tình huống không hiểu rõ lắm, đương nhiên không dám tùy tiện đưa tin."),i("br"),i("br"),n._v("Khả năng vốn kế hoạch, nếu như cái này có thể theo trong di tích đi ra, tự mình đi qua một chuyến, kết quả... Nhưng đi một lần không về."),i("br"),i("br"),n._v("“Là ai?” Híp mắt lại, Ngô sư nhìn qua."),i("br"),i("br"),n._v("Tổng bộ tất cả danh sư, hắn đều biết, đến cùng là ai?"),i("br"),i("br"),n._v("“Hiện tại chúng ta đều bị vây ở chỗ này, ai cũng ra không được, nói ra cũng không có bất cứ ý nghĩa gì...” Kê Nham lắc đầu."),i("br"),i("br"),n._v("Mọi người ra hay không ra, nói ra lại có ý nghĩa gì?"),i("br"),i("br"),n._v("Đã như vậy, còn không bằng không nói, miễn cho đồ sinh phiền não."),i("br"),i("br"),n._v("“Thật ra không được? Chẳng lẽ chúng ta muốn một mực vây ở chỗ này?”"),i("br"),i("br"),n._v("Hàn hội trưởng mở miệng."),i("br"),i("br"),n._v("“Ừm, phía ngoài phong ấn, có vào không ra, chắc hẳn các ngươi đều đã nhìn ra, hẳn là Khưu Ngô cổ thánh, tự mình bố trí... Trừ phi, nhận được hắn truyền thừa, hiểu rõ phong ấn bí ẩn, nếu không, không có khả năng rời khỏi!”"),i("br"),i("br"),n._v("Đàm Thanh cười khổ lắc đầu, đột nhiên nhớ tới cái gì, nhìn lại: “Đúng rồi, chúng ta lúc trước cùng Thiên Diệp Vương đám người dây dưa, không cách nào thoát thân, đành phải chạy trốn tới nơi này, các ngươi cùng nhau đi tới, hẳn là phát hiện thông hướng cổ thánh truyền thừa môn hộ a? Có thể hay không nhận được truyền thừa?”"),i("br"),i("br"),n._v("“Cái này...”"),i("br"),i("br"),n._v("Nghe nói như thế, Ngô sư đám người mặt mũi xấu hổ."),i("br"),i("br"),n._v("Cửa là tiến vào, cổ thánh pho tượng cũng gặp, thậm chí khảo hạch đều thông qua được, nhưng... Cuối cùng truyền thừa cũng không nhận được!"),i("br"),i("br"),n._v("Quỷ dị như vậy chuyện, nói ra, đoán chừng đối phương đều rất khó tin tưởng."),i("br"),i("br"),n._v("“Làm sao vậy? Chẳng lẽ... Chương viện trưởng dấu vết lưu lại các ngươi không thấy được?”"),i("br"),i("br"),n._v("Thấy mọi người biểu lộ kỳ quái, Kê Nham nhịn không được hỏi."),i("br"),i("br"),n._v("Cái kia ký hiệu rõ ràng như thế, hẳn là có thể đủ dễ dàng phát hiện đi!"),i("br"),i("br"),n._v("“Quả nhiên là các ngươi lưu lại, đã các ngươi biết cửa bên trong có truyền thừa, vì cái gì không vào xem?”"),i("br"),i("br"),n._v("Lần này đến phiên Hàn hội trưởng kì quái."),i("br"),i("br"),n._v("Là bọn họ lưu lại, đương nhiên tương đương mở ra cửa, xác định phương vị, đã như vậy, vì cái gì không đi vào? Thật muốn đi vào, cổ thánh xuất thủ, cái kia Thiên Diệp Vương liền chưa hẳn có thể sống đến hiện tại."),i("br"),i("br"),n._v("“Lúc ấy chúng ta tới trước cửa trước mặt, hơn nữa kích hoạt mở ra... Thế nhưng là, ngay tại mới vừa xác nhận vị trí, còn không có đi vào dò xét thời điểm, Thiên Diệp Vương liền đuổi đi theo. Cổ thánh truyền thừa, dính dáng quá lớn, ngộ nhỡ thật muốn bị đối phương nhận được, vô cùng có khả năng làm cho cả nhân tộc đều bị tai nạn... Chúng ta không dám đánh cược! Cho nên, viện trưởng trên mặt đất lặng lẽ dấu vết lưu lại, chạy về đằng này. Thiên Diệp Vương tính cách đa nghi, lại nhìn thấy chín cái cửa, cũng liền không tiến vào dò xét, tiếp tục đuổi tới, cuối cùng tất cả đều đến nơi này...”"),i("br"),i("br"),n._v("Kê Nham đem tình huống lúc đó nói một lần."),i("br"),i("br"),n._v("Hắn nói mặc dù hời hợt, nhưng mà, Trương Huyền đám người có thể suy đoán ra tàn khốc."),i("br"),i("br"),n._v("Mộ Nhân Hư đám người liền chết tại khoảng cách chín cái cửa chỗ không xa, thi thể đều không có người thu hồi, có thể đủ nhìn ra đương thời nguy hiểm."),i("br"),i("br"),n._v("“Đi vào nơi này về sau, mọi người bị nhốt, lại tiến hành nhiều lần chém giết, Dị Linh tộc nhân tuy chỉ còn lại có Thiên Diệp Vương một cái, chúng ta đến đây danh sư, cũng chết gần hết rồi... May mắn nơi này địa hình phức tạp, mới lấy hơi tàn, nếu không, khẳng định đã sớm toàn quân bị diệt...”"),i("br"),i("br"),n._v("Kê Nham than thở."),i("br"),i("br"),n._v("“Thì ra là thế!”"),i("br"),i("br"),n._v("Mọi người gật đầu."),i("br"),i("br"),n._v("Thiên Diệp Vương mạnh mẽ, bọn họ đều tự mình trải nghiệm qua, liền Ngô sư cùng Hàn hội trưởng liên thủ, đều chống lại không được, đương thời mọi người mới chỉ có Thánh vực nhất trọng đỉnh phong, đương nhiên càng không phương pháp."),i("br"),i("br"),n._v("Có thể sống đến hiện tại, có thể nói, đã rất không dễ dàng."),i("br"),i("br"),n._v("“Đúng rồi, các ngươi vẫn chưa trả lời chúng ta, đến cùng có hay không nhận được Khưu Ngô cổ thánh truyền thừa?”"),i("br"),i("br"),n._v("Giải thích xong, Kê Nham lần nữa nhìn lại, cái này liên lụy đến bọn họ có thể hay không rời khỏi, thực sự từ nội tâm chỗ sâu, muốn kiếm cái hiểu."),i("br"),i("br"),n._v("“Cái này... Khưu Ngô cổ thánh lưu lại ý niệm, bị Trương sư đả kích tán loạn, cũng không lưu lại truyền thừa!”"),i("br"),i("br"),n._v("Nhẫn nhịn hồi lâu, Ngô sư đành phải mở miệng."),i("br"),i("br"),i("br"),i("br")]),n._v(" "),i("hr"),n._v(" "),i("p",[i("a",{attrs:{href:"./chap-1082"}},[n._v("Chương trước")]),n._v("  |  "),i("a",{attrs:{href:"./chap-1084"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=t.exports}}]);